import React, {FC, PropsWithChildren} from 'react';

import s from "./styles.module.scss";

export const BaseLayout: FC<PropsWithChildren> = (props) => {
    const {children} = props;

    return (
        <div className={s.baseLayout}>
            {children}
        </div>
    );
};
